 have been put up for sale by a real estate agency it categorizes into for sale,leases and commercial properties','01/0218/3998','Mr. Walter','2018-06-09 07:42:48','2018-08-17 09:38:23','Yes','Yes','2018-06-09 09:19:05','7224241_7809497.png','3813062_4214318.png','4307837_6845517.png','2336507_2234201.png','0724114405','Yes In 2018',''),(9,18,'MIT','OneNote','My application helps the user to create, edit and save his/her documents','01/0218/4018','Mr. Walter','2018-06-09 07:43:16','2018-08-16 12:00:34','Yes','Yes','2018-06-09 08:28:11','9577281_9530169.png','3625090_3497626.png','6423962_6465062.png','2911329_1321444.png','0776188962','Yes In 2018',''),(10,9,'MIT','Proud Plus 254','Proud Plus 254 is an application that tries to showcases some of the Positive things about this country, Part from much the talked Negativity thorough this application you get to know the things you can be proud of about 254..I have featured five categories of items, this are: Historical figures, Celebrities The Big Five, Kenyan Heroes and the unsung Heroes. Each of these items contains a list of what they represent and the information about them.','01/0218/3988','Mr. Walter','2018-06-09 07:45:05','2018-08-17 09:36:36','Yes','Yes','2018-06-09 09:13:39','6947925_4720970.png','7366535_5485577.png','1036705_9997067.png','9155083_5800884.png','0796486683','Yes In 2018',''),(11,20,'MIT','Pied Piper(Tic-tac-toe)','Pied Piper (also known as noughts and crosses or Xs and Os) is a paper-and-pencil game for two players, X and O, who take turns marking the spaces in a 33 grid. The player who succeeds in placing three of their marks in a horizontal, vertical, or diagonal row wins the game.','01/0218/4009','Mr. Walter','2018-06-09 07:56:52','2018-08-17 13:50:21','Yes','Yes','2018-06-09 08:48:45','2371663_7397954.jpeg','7231534_6129945.jpeg','2101268_6955444.jpeg','6636611_5773463.jpeg','0782996653','Yes In 2018',''),(12,10,'MIT','tour kenya','This is an informational application that gives an informat